Full Description:
If you’re someone who is a heart-centered entrepreneur with services, products and support for people that are new age and cutting edge, have you ever wondered what the best way is to get your message across and serve your audience without compromising your own energy source and staying focused, intentional, and empowered? 
I don’t know if you’ve heard but I’m speaking at an incredible summit that is geared for entrepreneurs who are conscious professionals looking to recharge their energy source and get empowered and you can accomplish this in three days!
I promise you DO NOT want to miss the upcoming YES Mastermind Intensive!
16+ experts and heart-centered coaches and mentors who will be giving hands-on live coaching to help you eliminate your limiting beliefs and over 3 days giving you strategies to: 
Make more money;
Get healthier;
Get romance;
Have your home set up to empower and inspire you;
Inspire leadership in your community and at the workplace;
Source your spirituality; and
Have MORE fun and play!
What I’m most excited about is their theme this time out. They’ve cracked the code on SALES. Any entrepreneur will want to be at this event. 
Hey! You want some of that? Then get your tickets now to the YES Mastermind Intensive!
THURSDAY, JULY 28TH – SATURDAY JULY 30th 
8 AM – 4 PM PDT

&lt;p&gt;Join three cutting-edge Art World Experts to gain unique insight into the How, Why and What of collecting art today.&lt;/p&gt;
&lt;p&gt;Keen to acquire original art plus support contemporary artists and curators? Have a busy schedule and fancy being guided through the dos and don'ts, not to mention getting insider knowledge?&lt;/p&gt;
&lt;p&gt;Be Smart About Art and MOO are hosting a panel discussion + Q+A with three cutting-edge Art World Experts to provide budding millennial collectors with unique insight into the How, Why and What of buying art today, set to inform and inspire your own personal journey. Join Entrepreneur Jonas Almgren, CEO of ArtFinder, Gallerist Jessica Lloyd-Smith, Director of Modern ArtBuyer and Art Collector Yi Luo for this discussion, facilitated by Entrepreneur and Art World Specialist Susan J Mumford.&lt;/p&gt;
&lt;p&gt;The event will kick-off with mixing and mingling, providing you an opportunity to meet fellow art lovers, culture vultures and creative professionals. This will be followed by a facilitated conversation with the panelists, who will provide immense insight into the world of collecting - with purpose and passion. You'll then have an opportunity to ask your own burning questions (time permitting!) in the Q&amp;amp;A. The speakers will provide key take-away points for you to take with you, to exhibitions, fairs and other events, in the months and years to come. After the facilitated panel discussion comes to a close, all guests will be welcome to mix and mingle with guests and panelists before heading into the night.&lt;/p&gt;
&lt;p&gt;Refreshments will be provided.&lt;/p&gt;
&lt;p&gt;Bonus: Your ticket goes to support a wonderful cause! Net proceeds plus 30% of book sales will be donated to Shape Arts. The charitable entity provides opportunities and support for disabled artists and cultural organisations to build a more inclusive and representative cultural sector.&lt;/p&gt;
&lt;p&gt;We look forward to what's set to be a cracker of an event. #besmartaboutart&lt;/p&gt;
