Applications are now open for the Wise Guys Fintech 5 acceleration program starting in July in Bucharest, Romania! 
We are looking for a wide spectrum of B2B Fintech startups with a solid and passionate team, global ambition, and the power to execute. 10 to 12 selected teams will get access to: 
convertible investment up to 90K EUR + 250K EUR as a follow-on opportunity; 
a chance to connect with our community of 450+ mentors and investors, and 600+ founders; 
5 months long acceleration program to equip you for future growth. 
Wise Guys Fintech 5 acceleration program is supported by European Bank for Reconstruction and Development (EBRD) through EBRD’s TaiwanBusiness – EBRD Technical Cooperation fund.
